import {useState} from 'react'
import './App.css';
import AddPersons from './components/AddPersons';
import PersonsList from './components/PersonsList';

function App() {

  const [count , setCount ] = useState(0)

  const [personList , setPersonList] = useState ([
    {fName : "person1" , age : "25" , id : "01" , picUrl : "data:image/jpeg;base64,"} , 
    {fName : "person2" , age : "55" , id : "02" , picUrl : "data:image/jpeg;base64,"} , 
    {fName : "person3" , age : "40" , id : "03" , picUrl : "data:image/jpeg;base64,"} , 
  ])

  const incriment = () => {
    setCount(count + 1)
  }

  const decriment = () => {
    count > 0 ? setCount(count -1) : count = 0
  }

  // [personList , setPersonList]

  const handleAdd = (newPerson) => {
    setPersonList([...personList , newPerson ])
  }

  return (
    <div className="App">
      <button onClick={decriment}> - </button>
     <h1>   {count}  </h1>
    <button onClick={incriment} >  + </button> 

    <hr></hr>
    <hr></hr>

    <AddPersons handleAdd={handleAdd}></AddPersons>
    <hr></hr>
    <PersonsList personList={personList}   ></PersonsList>

    </div>
  );
}

export default App;
